import ReactDOM from 'react-dom';
import './index.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
//import App from './App';
import reportWebVitals from './reportWebVitals';
import React, { Component } from 'react'
import Layout from "./pages/Layout";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import NoPage from "./pages/NoPage";
import {CookiesProvider} from 'react-cookie';

export class Index extends Component {

  render() {
   let text_id= document.getElementById("#text")
   let root= document.getElementById("root")
   let text_class =document.getElementsByClassName(".text")
   let text_tag =document.getElementsByTagName("text")
   let text_nstag =document.getElementsByTagName("text")
   let text_name=document.getElementsByName("text")
   let nav = root.firstElementChild
   if(root.firstElementChild.previousSibling){
    console.log(root.firstElementChild.previousSibling.remove())

   }
   console.log("başlangıç")
   console.log(text_id)
   console.log(text_tag)
   console.log(text_nstag)
   console.log(text_name)
   console.log(text_class)
   console.log("bitiş")

  return (
    <CookiesProvider>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="*" element={<NoPage />} />
        </Route>
      </Routes>
    </BrowserRouter>
    </CookiesProvider>
  );
}
}
ReactDOM.render(<Index />, document.getElementById("root"));
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
